import Vue from 'vue'
import Router from 'vue-router'
import Login from '@/components/Login'
import Register from '@/components/Register'
import Bug from '@/components/Bug'
import Chart from '@/components/Chart'
Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Login',
      component: Login
    },
    {
      path: '/register',
      name: 'Register',
      component: Register
    },
    {
      path:'/bug',
      name:'Bug',
      component:Bug
    },
    {
      path:'/chart',
      name:'Chart',
      component:Chart
    }
  ],
  mode: "history"
})
